import './App.css';
import Header from './components/header/Header';
import Navbar from './components/navbar/Navbar';
import Profile from './components/profile/Profile';
import DialogsContainer from './components/dialogs/DialogsContainer';
import {BrowserRouter, Route, Routes} from 'react-router-dom';

function App(props) {
  return (
    <BrowserRouter>
    <div >
      <header>
        <Header />
      </header>
      <main>
        <Navbar sidebar={props.state.sidebarPage.sidebar}/>
        <Routes>
              <Route path='/profile' element={<Profile h='Profile' store={props.store}/>}/>
              <Route path='/dialogs/*' element={<DialogsContainer h='Dialogs' messages={props.state.dialogsPage.messages} dialogs={props.state.dialogsPage.dialogs} dispatch={props.dispatch} newMessageText={props.state.dialogsPage.newMessageText}/>}/>
        </Routes>
      </main>
    </div>
    </BrowserRouter>
  );
}

export default App;
